import React from "react";
import logo from "../../assets/logo.png"
import { NavText } from "../../styling/css";


const Navbar = () => {

    return (
        <div className="container" style={{
            display: "flex",
            backgroundColor: "white"
        }}>

            <div>
                <img src={logo} />
            </div>
            <div className="NavText" style={{
                paddingTop: "0.4rem",
                paddingLeft: "0.2rem"
            }}>
                <NavText>
                    <div>Scorecard</div>
                </NavText>
            </div>
            <div className="NavLinks" style={{ 
                color: "red", 
                flexDirection: "column", textDecoration: "none", justifyContent: "right"}}>

                    <a href="">Home</a>
                    <a href="">About</a>
                    <a href="">Learnings</a>
                    <a href="">Contact</a>
                    <button><a href="">Login</a></button>

            </div>

        </div>
    )
}

export default Navbar;
